/* jshint esversion: 6 */
pc.script.createLoadingScreen(function (app) {
    var showSplash = function () {
        // splash wrapper
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        // splash
        var splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);
        splash.style.display = 'block';
        
        var logo = document.createElement('img');
        logo.src = 'data:image/png;base64,';
        logo.id = 'logo';
        splash.appendChild(logo);
        
        var loaderBack = document.createElement('div');
        loaderBack.id = 'loaderBack';
        splash.appendChild(loaderBack);
        
        var loaderFrame = document.createElement('div');
        loaderFrame.id = 'loaderFrame';
        splash.querySelector('#loaderBack').appendChild(loaderFrame);
        
        var loaderBar = document.createElement('div');
        loaderBar.id = 'loaderBar';
        splash.querySelector('#loaderBack').appendChild(loaderBar);
        
        var loadingText = document.createElement('span');
        loadingText.innerHTML = '0%';
        loadingText.id = 'loadingText';
        splash.querySelector('#loaderBack').appendChild(loadingText);
    };

    var hideSplash = function () {
        famobi.log('v1.0; ©Famobi/IFGD, 2020');
        var wrapper = document.querySelector('#application-splash-wrapper');
        var transitionScreen = TransitionScreen.app.root.findByName("TransitionScreen");
        
        document.getElementById('loadingText').innerHTML = '100%';
        if(isExternalStart()) {
            transitionScreen.hidePreloader(true);
            if(wrapper && wrapper.parentElement) {
                wrapper.parentElement.removeChild(wrapper);
            }
        } else {
            if(wrapper) {
                wrapper.classList.add('hide');
                wrapper.addEventListener('transitionend', () => {
                    if(wrapper && wrapper.parentElement) {
                        wrapper.parentElement.removeChild(wrapper);
                    }
                });
                transitionScreen.hidePreloader(false);
            }            
        }
        app.fire(EventTypes.PRELOADER_FINISHED);
    };

    var setProgress = function (value) {
        var bar = document.getElementById('loaderBar');
        var loadingText = document.getElementById('loadingText');
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            const displayValue = value;
            bar.style.width = displayValue * 99 + '%';
            loadingText.innerHTML = Math.round(displayValue * 99) + '%';
        }
        const loadingProgressValue = value * 99; 
        if(typeof famobi !== "undefined" && famobi.setPreloadProgress) {
            famobi.setPreloadProgress(Math.floor(loadingProgressValue));
        }
    };

    var createCss = function () {
        var css = [
            
            'body {',
            '    background-color: #1D1D15;',
            '}',
            
            'html {',
            '    background-color: #1D1D15;',
            '}',
            
            '.hide {',
            '   opacity: 0 !important;',
            '   transition: opacity 0.3s ease-in;',
            '}',
            
            '#logo {',
            '   position: absolute;',
            '   bottom: 70px;',
            '   left: calc(50% - 196px);',
            '}',
    
            '#application-splash-wrapper {',
            '    position: absolute;',
            '    top: 0;',
            '    left: 0;',
            '    height: 100%;',
            '    width: 100%;',
            '    background-color: #1D1D15;',
            '}',

            '#application-splash {',
            '    position: absolute;',
            '    height: 250px;',
            '    width: 390px;',
            '    left: 0;',
            '    right: 0;',
            '    top: -40px;',
            '    bottom: 0;',
            '    margin: auto;',
            '}',

            '#application-splash img {',
            '    width: 100%;',
            '}',
            
            '#loaderBack {',
            '    bottom: 0;',
            '    height: 50px;',
            '    width: 100%;',
            '    position: absolute;',
            "    background-image: url('data:image/png;base64,');",
            '    background-repeat: no-repeat;',
            '    background-position: left center;',
            '    background-size: 390px 100%;',
            '    z-index: 10',
            '}',
            
             '#loaderFrame {',
            '    height: 100%;',
            '    width: 100%;',
            '    position: absolute;',
            "    background-image: url('data:image/png;base64,');",
            '    background-repeat: no-repeat;',
            '    background-position: left center;',
            '    background-size: 390px 100%;',
            '    z-index: 15',
            '}',
            
            '#loaderBar {',
            '    height: 100%;',
            '    width: 0%;',
            '    position: absolute;',
            "    background-image: url('data:image/png;base64,');",
            "    background-repeat: no-repeat;",
            "    background-size: 390px 100%;",
            '}',
            
            '#loadingText {',
            '    color: white;',
            '    font-size: 26px;',
            '    font-weight: bold;',
            '    line-height: 50px;',
            '    left: 0;',
            '    right: 0;',
            '    top: 0;',
            '    bottom: 0;',
            '    margin: auto;',
            '    position: absolute;',
            '    text-align: center;',
            '    z-index: 100;',
            '}',
                        
            '@media (max-width: 480px) {',
            '   #application-splash {',
                '   height: 120px;',
                '   width: 195px;',
                '   top: 0;',
                '}',

                '#loaderBack {',
                '    height: 25px;',
                '    background-size: 195px 100%;',
                '}',
            
                 '#loaderFrame {',
                '    background-size: 195px 100%;',
                '}',
                
                '#loaderBar {',
                "    background-size: 195px 100%;",
                '}',
            
                '#loadingText {',
                '    font-size: 16px;',
                '    line-height: 23px;',
                '    top: 1px;',
                '}',
            
                '#logo {',
                '   position: absolute;',
                '   bottom: 40px;',
                '   left: calc(50% - 95px);',
                '}',
            '}'
        ].join("\n");

        var style = document.createElement('style');
        style.type = 'text/css';
        if (style.styleSheet) {
          style.styleSheet.cssText = css;
        } else {
          style.appendChild(document.createTextNode(css));
        }

        document.head.appendChild(style);
    };

    
    var injectForcedModeProperties = function() {
        console.warn('Injecting forced mode properties...');
        const forcedModeProperties = getForcedModeProperties();        
        
        if(forcedModeProperties.override.tower_width) {
            GameConfig.setAttribute('numRows', forcedModeProperties.override.tower_width);
        }
        if(forcedModeProperties.override.tower_height) {
            GameConfig.setAttribute('bubbleLines', forcedModeProperties.override.tower_height);
        }
        if(forcedModeProperties.override.num_colors) {
            GameConfig.setAttribute('availableColors', forcedModeProperties.override.num_colors);
        } 
        if(forcedModeProperties.override.fireball_cooldown >= 0) {
            GameConfig.setAttribute('fireballCooldown', forcedModeProperties.override.fireball_cooldown);
        }            
    };
    
    
    var doAPIHandshake = function(startGameCallback) {   
        if(isExternalStart()) {
            app.timeScale = 0;
            famobi.onRequest("startGame", function() {
                app.timeScale = 1.0;                               
                if(startGameCallback) startGameCallback();
            });
        } else {
            if(startGameCallback) startGameCallback();
        }

        /* game ready report */
        famobi.gameReady();
    };
    
    var startLevelDirectly = function() {
        
        // WindowManager.startGameplay();
        app.fire(EventTypes.OPEN_GAMEPLAY_SCREEN);
        
         /* timeout is a must to let the game properly initialize level */
        setTimeout(() => doAPIHandshake(() => {
            app.fire(EventTypes.APPLICATION_STARTED);
            famobi.log('Handshake completed, skip_title mode');
        }), 0);
    };
    
    
    createCss();

    showSplash();    
    
        
    app.on('preload:end', function () {
        app.off('preload:progress');
    });
    app.on('preload:progress', setProgress);
    app.on('start', function() {
        famobi.log('App is starting...');
    });
    app.on('postinitialize', () => {
         /* game is loaded, send final progress to Famobi API. */
        famobi.setPreloadProgress(100);
        
        /* inject forced mode properties if needed */
        if(isForcedMode()) {
            injectForcedModeProperties();
        }
        
        /* hide preloader and thus display the target screen */
        hideSplash();
        
        /* if running into MonkeyGames container, start the gameplay/level screen directly */
        if(skipTitleScreen()) {
             startLevelDirectly();                
        } else {
            app.fire(EventTypes.OPEN_MAIN_MENU);
            
             /* timeout is a must to let the game properly initialize a level */
             setTimeout(() => doAPIHandshake(() => {
                 app.fire(EventTypes.APPLICATION_STARTED);
                 famobi.log('Handshake completed in normal gameplay mode');
             }), 0);
        }    
                        
    });
});